{"reasoning":"Ground truth bug concerns a partially submerged boat shifting/moving when the player walks on its deck. Key elements: presence of a boat, player walking on boat surface, resulting unintended boat movement.

Generated report describes a completely different scenario: the character can walk directly on water, not on a boat, with the issue being lack of proper water-interaction physics for the character. There is no mention of a boat or boat movement. Therefore the core symptoms, objects involved, and outcomes differ.
","match":false}

{"reasoning":"The ground truth bug concerns a helicopter whose rotor blades incorrectly clip through a bridge, allowing the helicopter to remain stuck without crashing; the core issue is wrong collision detection/physics between helicopter blades and bridge geometry.

The generated bug report instead describes a visual rendering problem where a character viewed through a scope becomes partially transparent and flickers, affecting aiming. This involves mesh/texture transparency and flickering, not collision or physics of a helicopter.

The two bugs involve completely different objects (helicopter vs character), different subsystems (collision/physics vs rendering), and different symptoms. Therefore they do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth describes a bug where a seaplane (or water-landed plane) suddenly shoots upward into the air; the debris/explosion pieces do not follow the plane’s geometry, giving an unrealistic projection of the aircraft itself. The key elements are: object = plane, condition = resting on water, symptom = whole plane catapulted upwards with inconsistent debris orientation.

Generated report describes a torpedo explosion whose visual effect is rendered too high above the water and is visually faint. Key elements: object = torpedo explosion effect, condition = torpedo impact, symptom = explosion VFX positioned above surface and weak intensity.

Although both involve water and vertical misplacement, one concerns the physical behavior of a plane model and its debris, while the other concerns the placement/intensity of an explosion visual effect. They do not describe the same bug.","match":false}

{"reasoning":"Ground truth describes an unmanned ATV spinning in circles while intersecting a corpse on the ground. Key elements are: no rider, circling motion, and clipping through a dead NPC.

Generated report describes an ATV WITH its rider driving upside-down on a road. Key elements are: rider present, vehicle inverted, no mention of circling or clipping with a corpse.

The core symptoms, circumstances, and visual results are different, indicating two distinct bugs.","match":false}

{"reasoning":"Ground truth focuses on incorrect physics/animation: an animal-like creature is floating and darting toward/through the player, giving unrealistic movement. 

Generated report deals with graphics/rendering problems: character transparency, flickering, lighting artifacts, UI overlapping. It makes no mention of floating or rapid movement toward the player, and instead targets visual rendering issues.

Therefore, they describe different problems.","match":false}

{"reasoning":"The ground-truth bug is that, after being hit, an enemy stops, then its model becomes distorted: it floats/hovers above the ground while its limbs spin and shake.  The essential visible symptom is an enemy that is levitating and moving in an erratic, physically impossible manner.

The generated report also describes a character that "is observed floating and moving in an unnatural manner, defying the laws of physics… levitating and moving erratically."  Although it omits the exact trigger (being attacked) and the specific detail of the limbs spinning, it nevertheless reports the same core manifestation: a character that hovers above the ground and moves erratically/unnaturally, breaking physics.  No contradictory or mutually exclusive details are introduced.

Therefore the generated report is referring to the same underlying bug as the ground truth description.","match":true}
